import { useEffect, useState } from 'react';
import { supabase } from './supabase';
import { useNavigate } from 'react-router-dom';
import {
  Typography,
  Button,
  Container,
  Box,
  Divider,
  CircularProgress,
  Paper,
  List,
  ListItem,
  ListItemText
} from '@mui/material';

function Dashboard() {
  const [ownedProjects, setOwnedProjects] = useState([]);
  const [invitedProjects, setInvitedProjects] = useState([]);
  const [userEmail, setUserEmail] = useState('');
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchProjects = async () => {
      const { data: userData, error: userError } = await supabase.auth.getUser();
      const user = userData?.user;

      if (!user) {
        navigate('/login');
        return;
      }

      setUserEmail(user.email);

      try {
        // Get owned projects
        const { data: owned, error: ownedError } = await supabase
          .from('projects')
          .select('*')
          .eq('owner_id', user.id);

        if (ownedError) throw ownedError;
        setOwnedProjects(owned);

        // Get invited project IDs from invitations
        const { data: invites, error: inviteError } = await supabase
          .from('invitations')
          .select('project_id')
          .eq('invited_email', user.email);

        if (inviteError) throw inviteError;

        const projectIds = invites.map(i => i.project_id);

        // Get project details
        let invited = [];
        if (projectIds.length > 0) {
          const { data: invitedProjects, error: invitedError } = await supabase
            .from('projects')
            .select('*')
            .in('id', projectIds);

          if (invitedError) throw invitedError;
          invited = invitedProjects;
        }

        setInvitedProjects(invited);
      } catch (err) {
        console.error('Error fetching projects:', err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchProjects();
  }, [navigate]);

  const handleDelete = async (projectId) => {
    const confirmed = window.confirm('Are you sure you want to delete this project? This cannot be undone.');
    if (!confirmed) return;
  
    const { error } = await supabase
      .from('projects')
      .delete()
      .eq('id', projectId);
  
    if (error) {
      console.error('Error deleting project:', error.message);
      alert('Failed to delete project.');
    } else {
      // Remove the deleted project from the state
      setOwnedProjects((prev) => prev.filter(p => p.id !== projectId));
      alert('Project deleted.');
    }
  };
  

  return (
    <Container maxWidth="md" sx={{ mt: 5 }}>
      <Typography variant="h4" gutterBottom>Welcome to Your Dashboard</Typography>
      <Typography variant="body1" sx={{ mb: 4 }}>Logged in as: <strong>{userEmail}</strong></Typography>

      <Box sx={{ mb: 4 }}>
        <Button variant="contained" onClick={() => navigate('/create-project')}>
          + Create New Project
        </Button>
      </Box>

      {loading ? (
        <CircularProgress />
      ) : (
        <>
          <Paper sx={{ p: 2, mb: 4 }}>
            <Typography variant="h6">Your Projects</Typography>
            <Divider sx={{ mb: 1 }} />
            {ownedProjects.length === 0 ? (
              <Typography variant="body2">You haven’t created any projects yet.</Typography>
            ) : (
              <List>
                {ownedProjects.map((project) => (
                  <ListItem key={project.id}>
                    <ListItemText
                      primary={project.project_name}
                      secondary={`Start: ${project.start_date} — End: ${project.end_date}`}
                    />
                  </ListItem>
                ))}
              </List>
            )}
          </Paper>

          <Paper sx={{ p: 2 }}>
            <Typography variant="h6">Projects You’ve Been Invited To</Typography>
            <Divider sx={{ mb: 1 }} />
            {invitedProjects.length === 0 ? (
              <Typography variant="body2">No invitations yet.</Typography>
            ) : (
              <List>
                {invitedProjects.map((project) => (
                  <ListItem
                  key={project.id}
                  secondaryAction={
                    <Button
                      variant="outlined"
                      color="error"
                      onClick={() => handleDelete(project.id)}
                    >
                      Delete
                    </Button>
                  }
                >
                  <ListItemText
                    primary={project.project_name}
                    secondary={`Start: ${project.start_date} — End: ${project.end_date}`}
                  />
                </ListItem>
                
                ))}
              </List>
            )}
          </Paper>
        </>
      )}
    </Container>
  );
}

export default Dashboard;
